import { Container, Row, Col} from "react-bootstrap";

export default function AccountPage() {
    return (
        <Container>
            <Row className="mt-5"> 
                <Col xs={12} md={{ span: 6}} className='mb-5'>
                    <img 
                        src='/img/images (1).jpg'
                        alt='profile'
                        style={{
                            width: '200px',
                            height: '200px'
                        }}
                    />
                </Col>
            </Row>
        </Container>
    )
}
